// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract DAO {
    // 안건은 어떻게 생겨먹음?
    // 앞에 하나 빼먹었음. 오늘들어갈 새로운 구조의 형태 => struct 5.struct
    // 메모리 의 개념 한번호출되면 사라짐
    address private chairperson;

    struct Proposal {
        string title;
        uint yes;
        uint no;
        bool finished;
        mapping(address => bool) voted;
    }

    uint private proposalCount = 0; //안건의 아이디 상태
    mapping(uint => Proposal) public proposal;

    uint private memberCount;
    mapping(address => bool) private members;
    // 배포했을 때
    constructor(address owner) {
        chairperson = owner;
        // 의장도 사람이야 사람 멤버란말이야
        members[owner] = true;
        memberCount++;
    }

    modifier onlychairoerson() {
        require(msg.sender == chairperson, "Only chairperson allowed");
        _;
    }
    modifier onlyChairperson() {
        require(msg.sender == chairperson, "Only chairperson allowed");
        _;
    }
    modifier onlyMemder() {
        require(members[msg.sender], "you not Member!");
        _;
    }
    function setMember(address _address) public onlychairoerson {
        // 맴버로 승인
        members[_address] = true;
        memberCount++;
    }
    // _title: "프로틴을 뺐어야한다"
